import React from 'react';
import '../Styles/Navbar.css';

import {NavLink } from 'react-router-dom';
const Navbar=()=>{
    return(
<>
<ul>
<li><NavLink activeClassName="active_class" to="/about">About </NavLink></li>
<li><NavLink activeClassName="active_class" to="/">Home </NavLink></li>
<li><NavLink activeClassName="active_class" to="/project"> Project</NavLink></li>
<li><NavLink activeClassName="active_class" to="/contact">Contact</NavLink></li>
</ul>
</>
    );
}
export default Navbar;
